import React from 'react'
import { PokemonCard } from './PokemonCard'
import './Cards.css'
export const AllCards = ({ results }) => {
    /*console.log("Resultados desde AllCards:",results)
    results.map(res=>(
        console.log(res.name)
    ))*/
    return (
        <div className='container'>
            <ul className='cards'>
                {results.map(res =>
                (
                    <li className='card-item' key={res.name}>
                        <PokemonCard url={res.url} />
                    </li>

                ))}
            </ul>
        </div>
    )
}
